import 'package:flutter/material.dart';

class HomeScreen extends StatefulWidget {
  const HomeScreen({super.key});

  @override
  State<HomeScreen> createState() => _HomeScreenState();
}

class _HomeScreenState extends State<HomeScreen> {
  @override
  Widget build(BuildContext context) {
    return Scaffold(
        body: Column(
      mainAxisAlignment: MainAxisAlignment.spaceEvenly,
      children: [
        Text("Nature 1 ",
          style: TextStyle(
              fontSize: 30,
              backgroundColor: Colors.deepPurple,
              color: Colors.white),
        ),
        GestureDetector(
          onTap: () {
            Navigator.push(context,
                MaterialPageRoute(builder: ((context) => nature1())));
          },
          child: Container(
            height: 200,
            width: double.maxFinite,
            child: Image.network(
              "data:image/jpeg;base64,",
              fit: BoxFit.fill,
            ),
            color: Colors.blue,
          ),
        ),
        Text(
          "Nature 2",
          style: TextStyle(
              fontSize: 30,
              backgroundColor: Colors.deepPurple,
              color: Colors.white),
        ),
        GestureDetector(
          onTap: (() {
            Navigator.push(
                context, MaterialPageRoute(builder: (context) => nature2()));
          }),
          child: Container(
            height: 200,
          
            child: Image.network(
              "data:image/jpeg;base64,",
              fit: BoxFit.fill,
            ),
            color: Colors.yellow,
          ),
        ),
      ],
    ));
